import React from "react";
import Box from "@material-ui/core/Box";

const index = () => {
  return (
    <div>
      <Box
        style={{
          height: "400px",
          width: "90%",
          backgroundColor: "white",
          marginLeft: "60px",
          marginTop: "30px",
          boxShadow: "  1px 4px  7px 5px #E5E5E5",
        }}
      >
        <Box style={{ display: "flex" }}>
          <Box
            style={{
              flex: 2,
              padding: "0px 20px",
              height: "10%",
              backgroundColor: "green",
            }}
          ></Box>
          <Box
            style={{ flex: 2, padding: "0px 20px", backgroundColor: "black" }}
          ></Box>
        </Box>
      </Box>
    </div>
  );
};
export default index;
